import React, { useState, useEffect } from "react";
import Select from "react-select";
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

const CurrencySwap = () => {
  const [currencies, setCurrencies] = useState<{ value: string; label: string; image: string }[]>([]);
  const [prices, setPrices] = useState<Record<string, number>>({});
  const [fromCurrency, setFromCurrency] = useState<{ value: string; label: string; image: string } | null>(null);
  const [toCurrency, setToCurrency] = useState<{ value: string; label: string; image: string } | null>(null);
  const [amount, setAmount] = useState<number>(0);
  const [result, setResult] = useState<number>(0);

  useEffect(() => {
    fetch("https://interview.switcheo.com/prices.json")
      .then((res) => res.json())
      .then((data) => {
        const priceMap: Record<string, number> = {};
        data.forEach((item: { currency: string; price: number }) => {
          priceMap[item.currency] = item.price;
        });
        setCurrencies(
          Object.keys(priceMap).map((cur) => ({
            value: cur,
            label: cur,
            image: `/assets/tokens/${cur}.svg`,
          }))
        );
        setPrices(priceMap);
      });
  }, []);

  const handleSwap = () => {
    if (fromCurrency && toCurrency && amount > 0) {
      const fromPrice = prices[fromCurrency.value];
      const toPrice = prices[toCurrency.value];
      setResult((amount * fromPrice) / toPrice);
    }
  };

  const customSingleValue = ({ data }: any) => (
    <div className="flex items-center">
      <img src={data.image} alt={data.label} className="w-6 h-6 mr-2" />
      {data.label}
    </div>
  );

  const customOption = (props: any) => {
    const { data, innerRef, innerProps } = props;
    return (
      <div ref={innerRef} {...innerProps} className="flex items-center p-2 hover:bg-gray-100 cursor-pointer">
        <img src={data.image} alt={data.label} className="w-6 h-6 mr-2" />
        {data.label}
      </div>
    );
  };

  return (
    <div className="max-w-md mx-auto mt-10 p-6 bg-white rounded-lg shadow-lg">
      <h2 className="text-xl font-bold mb-4">Currency Swap</h2>
      <div className="mb-4">
        <label className="block text-gray-700 mb-2">From</label>
        <Select options={currencies} onChange={setFromCurrency} components={{ SingleValue: customSingleValue, Option: customOption }} />
      </div>
      <div className="mb-4">
        <label className="block text-gray-700 mb-2">To</label>
        <Select options={currencies} onChange={setToCurrency} components={{ SingleValue: customSingleValue, Option: customOption }} />
      </div>
      <div className="mb-4">
        <label className="block text-gray-700 mb-2">Amount</label>
        <input
          type="number"
          className="w-full p-2 border rounded"
          value={amount}
          onChange={(e) => setAmount(Number(e.target.value))}
        />
      </div>
      <button
        onClick={handleSwap}
        className="w-full bg-blue-500 text-white p-2 rounded hover:bg-blue-600"
      >
        Swap
      </button>
      {result > 0 && (
        <div className="mt-4 p-3 bg-green-100 text-green-800 rounded">
          You will get: {result.toFixed(4)} {toCurrency?.value}
        </div>
      )}
    </div>
  );
};

export default CurrencySwap;


